    return (
        <View style={styles.container}>
            <View style={styles.imageContainer}>
                <Image style={styles.welcomeImg} source={welcomeImg}></Image>    
            </View>{/** image */}
            <View style={styles.formContainer}>

            </View>{/** sign up form */}
        </View>
    )
}

const styles = StyleSheet.create({
